import { Component } from '@angular/core';


@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})

export class RegisterComponent {

  private aspNetUser: any;
  email:any = "";
  password:any = "";

  constructor(){

  }

  register(){
    console.log(this.email);
    console.log(this.password);
  }
}
<p>register works!</p>
<div class="container" style="width: 30%;">
  <h2 class=" d-flex justify-content-center">Registro</h2>
  <div class="form-floating mb-3  d-flex justify-content-center">
      <input class="form-control" placeholder="name@example.com" type="text" [(ngModel)]='email'/>
      <label class="form-label">Email</label>
  </div>
  <div class="form-floating mb-3  d-flex justify-content-center">
      <input class="form-control" placeholder="password" type="text" [(ngModel)]='password'/>
      <label class="form-label">Password</label>
  </div>
  <div class="form-floating mb-3  d-flex justify-content-center">
    <input class="form-control" placeholder="password" />
    <label class="form-label">Confirmar Password</label>
  </div>
  <div>
      <button class="w-100 btn btn-lg btn-primary  d-flex justify-content-center"
      id="login-submit" type="submit" (onClick)="register()">Registrar</button>
  </div>
</div>
